function CardProduct1(props){
    return(
        <>
        <div className="cart">
            <img className="banner-4-img" src={props.img} alt="..."/>
            <p className="banner-4-namecard">Isekai #3683</p>
            <p className="banner-4-infor-card">Isekai Meta</p>
            <span className="icon-card blue-stick banner-4-bluestick"/>
            <div className="name-stick">
                <p className="infor-name-1">Isekai Meta</p>
                <span className="icon-card blue-stick"/>
            </div>
        </div>
        </>
    )
};
export default CardProduct1;

